import React from 'react';
import { Container, Row, Col } from 'reactstrap';

const Index = () => (
    // border bottom
    <Container>
    <Row>
      <Col>.col</Col>
      <Col>.col</Col>
      <Col>.col</Col>
    </Row>
    </Container>
    //before container row then the card
  )
  export default Index
